import { Injectable } from '@angular/core';
import { Http,Headers } from '@angular/http';
import { Observable } from "rxjs/Observable";
import * as pdfMake from 'pdfmake/build/pdfmake';
import * as pdfFonts from 'pdfmake/build/vfs_fonts';
import * as moment from 'moment';

@Injectable()
export class RefacaoBriefingService {
  http: Http;
  headers: Headers;
  public id;
  url: string = "//localhost:3001/api/reBrief/";

  constructor(http: Http) {
    this.http = http;
    this.headers = new Headers();
    this.headers.append('Content-Type', 'application/json');
    moment.locale('pt-br');
  }
  cadastrar(briefing,campanha,produto,cliente): Observable<any>{
    return this.http.post(this.url+"salva", JSON.stringify(briefing), {headers: this.headers}).map(res =>{
      let result = res["_body"];
      this.id = result;
      briefing.hora_cadastrada = moment(briefing.hora_cadastrada).format("DD/MM/YYYY HH:mm")
      this.gerarPDF(briefing, this.id,campanha,produto,cliente);
    })
  }
  gerarPDF(briefing,id,campanha,produto,cliente){
    pdfMake.vfs = pdfFonts.pdfMake.vfs;
    let entrega = campanha.final_campanha;

    if( !(entrega.indexOf('/')>0) ){
      entrega = "Entrega não definida";
    }
    
    if(briefing.publico_demografico == " ")
      briefing.publico_demografico = " Público não obrigatório"
    if(briefing.publico_perfil == " ")
      briefing.publico_perfil = " Público não obrigatório"
    if(briefing.publico_comportamental == " ")
      briefing.publico_comportamental = " Público não obrigatório"


    if(briefing.insight == undefined)
      briefing.insight = "Inspirações não obrigatório"

    let docDefinition = {
      pageSize:'A4',
      content: [
        {
          
          columns:[
            // imagem em base 64
            {
              image: 'data:image/jpeg;base64,',
              width: 60,
              height:60,
              margin: [0, -20],

            },
            {
              fontSize: 11,
              margin: [0, -15, 0, 0],
              text: 'Solicitante: '+briefing.responsavel+'\n'+'Cliente: '+cliente.nome_cliente+"\n"+'Campanha: '+campanha.nome_campanha+"\n"+'Produto: '+produto.nome+"\nID do brief da agência: "+briefing.agencyBrief_id,
            },
            {
              alignment: 'right',
              fontSize: 11,
              margin: [0, -15, 0, 0],
              text:'ID: '+id+'\nFormalizado: '+briefing.hora_cadastrada+"\n"+" Período Campanha: "+campanha.comeco_campanha+" - "+entrega,
              width: 285
            }            
          ]
        },
        {
          style: 'linhaTop',
          color: '#ee1a39',
          bold: true,
          alignment: 'center',
          text:'Agency Brief',
        },
        {
          style: 'linha',
          table: {
            widths: [500],
            body: [
              [
                {
                    style: 'bold',
                    border:[false,false,false,false],
                    text: '1 - Qual problema a comunicação deve resolver?'
                },
              ],
              [
                  {
                      border:[true,true,true,true],
                      text: briefing.objetivo
                  }    
              ]
              
            ]
          }
        },
        {
          style: 'linha',
          table: {
            widths: [500],
            body: [
              [
                {
                    style: 'bold',
                    border:[false,false,false,false],
                    text: '2 - Com quem vamos falar?'
                },
            ],
            [
              {
                  style: 'bold',
                  border:[true,true,true,false],
                  text: 'Perfil demográfico: '
              },
            ],
            [
                {
                    border:[true,false,true,false],
                    text: briefing.publico_demografico
                }    
            ],
            [
              {
                  style: 'bold',
                  border:[true,false,true,false],
                  text: 'Perfil Social: '
              },
            ],
            [
                {
                    border:[true,false,true,false],
                    text: briefing.publico_perfil
                }    
            ],     
            [
              {
                  style: 'bold',
                  border:[true,false,true,false],
                  text: 'Perfil Comportamental: '
              },
            ],
            [
                {
                    border:[true,false,true,true],
                    text: briefing.publico_comportamental
                }    
            ],                     
          ]
          }
        },
        {
          style: 'linha',
          table: {
            widths: [500],
            body: [
              [
                {
                    style: 'bold',
                    border:[false,false,false,false],
                    text: '3 - Qual insight pode inspirar a comunicação?'
                },
              ],
              [
                  {
                      border:[true,true,true,true],
                      text: briefing.insight
                  }    
              ]
              
            ]
          }
        },
        {
          style: 'linha',
          table: {
            widths: [500],
            body: [
              [
                {
                    style: 'bold',
                    border:[false,false,false,false],
                    text: '4 - Qual é a principal mensagem/território? '
                },
              ],
              [
                  {
                      border:[true,true,true,true],
                      text: briefing.mensagem
                  }    
              ]
              
            ]
          }
        },
        {
          style: 'linha',
          table: {
            widths: [500],
            body: [
              [
                {
                    style: 'bold',
                    border:[false,false,false,false],
                    text: '5 - Por que acreditar nessa mensagem/pilares que sustentam o território?'
                },
              ],
              [
                  {
                      border:[true,true,true,true],
                      text: briefing.pilares
                  }    
              ]
              
            ]
          }
        },
        {
          style: 'linha',
          table: {
            widths: [500],
            body: [
              [
                {
                    style: 'bold',
                    border:[false,false,false,false],
                    text: '6 - O que é preciso criar?'
                },
              ],
              [
                  {
                      border:[true,true,true,true],
                      text: briefing.entregaveis
                  }    
              ]
              
            ]
          }
        },
        {
          style: 'linha',
          table: {
            widths: [500],
            body: [
              [
                {
                    style: 'bold',
                    border:[false,false,false,false],
                    text: '7 - Informações relevantes'
                },
              ],
              [
                  {
                      border:[true,true,true,true],
                      text: briefing.informacoes
                  }    
              ]
              
            ]
          }
        },
        {
          style: 'linha',
          table: {
            widths: [500],
            body: [
              [
                {
                    style: 'bold',
                    border:[false,false,false,false],
                    text: '8 - Mandatorio'
                },
              ],
              [
                  {
                      border:[true,true,true,true],
                      text: briefing.mandatorio
                  }    
              ]
              
            ]
          }
        },
      ],
      styles: {
        bold:{
          bold: true
        },
        linha: {
          margin: [0, 5, 0, 5],          
        },
        linhaTop: {
          margin: [0, 25, 0, 10],
          
        }
      }
    };
    
    pdfMake.createPdf(docDefinition).download("briefing"+id+".pdf");
  }

}
